script: |
  super -f text -I q13234.spq | sort > q13234.out

inputs:
  - name: q13234.spq
    data: |
      SELECT col0 FROM tab2 (FORMAT parquet) WHERE NOT col2 + - col0 + - - 90 IN ( + col0, - 4, - - 71, - col1, + - col1 * - - 30 / + - 76 * + col1, 78 );
  - name: tab2

outputs:
  - name: q13234.out
    data: |
      46
      64
      75
